import React, { Component } from 'react';
import PersonalPhoto from './photo/personal_photo.jpg';
import Photo1 from './photo/photo1.jpg';
import Photo2 from './photo/photo2.jpg';
import Photo3 from './photo/photo3.JPG';
import Photo4 from './photo/photo4.JPG';
import Photo5 from './photo/photo5.jpg';
import Photo6 from './photo/photo6.jpg';
import './css/home.css'


class Home extends Component {
  render() {
    return (
	<div className="Home" class="backgroundimage" style={{ height:'120%', position: 'absolute', left: '0px', width: '100%', overflow: 'hidden'}}>
	  
	 <div class="grid-cont1" >
	<div class="photo"><img src={PersonalPhoto} alt="" width="160px" height="220px"/></div>
	<div class="intro">
	<h1 class="p2">Hi, I am Tommy, a system engineer from Hong Kong.</h1>
	<p class="p1"><i>Fast learner and willing to take new challenge. Able to work under pressure and independently. A team player with good time management. Passionate in software development, game development and machine learning</i></p>
	</div>  
	
	<div class="main">
	<p class="p1">Welcome to my personal website. I am To Nok Hang, Tommy. I am a system engineer from Hong Kong. I obtain <b>BEng-Computer Science</b> in 
	<b> The Hong Kong University of Sceince and Technology.</b>
	<br/>I have a diverse of skills in front-end and back-end programing. Also, I am a game developer which has developed a puzzle-solving game in my final year project.
	Please feel free to read my portfolio or <a href = "mailto: tommyto0925@gmail.com">contact me</a>.
	</p>
	<p class="p1">
	Personal hobbies: Football (2018-2021 HKUST CSE Football Team), Badminton, Hiking, Cycling, Photography<br/><br/>
	Photography gallery:<br/><br/>
	<div><img src={Photo1} alt="" width="250px" height="260px"/>
	<img src={Photo2} alt="" width="250px" height="260px"/>
	<img src={Photo3} alt="" width="250px" height="260px"/>
	<img src={Photo4} alt="" width="250px" height="260px"/>
	<img src={Photo5} alt="" width="250px" height="260px"/>
	<img src={Photo6} alt="" width="250px" height="260px"/>
	</div>
	
	</p>
	</div>
	
	</div>
	
      </div>
	  
	  
    );
  }
}

export default Home;
